//O arquivo App.js é onde é definido ecomponente principal da sua aplicação. Neste caso, o componente App é renderizado dentro da <div id="root"> no HTML. O conteúdo desse componente pode incluir outros componentes, estilização, e lógica específica da aplicação. O componente App é o ponto de entrada da sua aplicação React.

// Importa o arquivo de estilos CSS associado ao componente App.
import './App.css';

// Importa o componente Login do arquivo ./components/Login.
import Login from './components/Login';

// Define o componente principal App.
function App() {

  // Define o retorno a estrutura do componente App.
  return (

    // Container principal da aplicação, utilizando a classe "App" para estilização.
    <div className="App">

      {/* Cabeçalho da aplicação, utilizando a classe "App-header" para estilização. */}
      <header className="App-header">

        {/* Renderiza o componente Login dentro do cabeçalho da aplicação. */}
        <Login />
      </header>
    </div>
  );
}

// Exporta o componente App para que possa ser utilizado em outros arquivos.
export default App;
